const Shop = ({ onAddToCart }) => {
 
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [sortOption, setSortOption] = useState('newest');

  
  let productsToShow = [];

  switch (selectedCategory) {
    case 'Food':
      productsToShow = foodData;
      break;
    case 'Toys':
      productsToShow = toysData;
      break;
    case 'Accessories':
      productsToShow = accessoriesData;
      break;
    case 'Grooming':
      productsToShow = groomingData;
      break;
    default:
      // " " (80 )
      productsToShow = [...foodData, ...toysData, ...accessoriesData, ...groomingData];
  }


  if (sortOption === 'price-low') {
    productsToShow.sort((a, b) => a.price - b.price);
  } else if (sortOption === 'price-high') {
    productsToShow.sort((a, b) => b.price - a.price);
  }

 
  const getHeroContent = () => {
    switch (selectedCategory) {
      case 'Food': return { title: 'Healthy Food', desc: 'Delicious & Nutritious meals for every pet.' };
      case 'Toys': return { title: 'Fun Toys', desc: 'Keep them active and happy all day long.' };
      case 'Accessories': return { title: 'Stylish Accessories', desc: 'Collars, beds, and more for comfort.' };
      case 'Grooming': return { title: 'Grooming Essentials', desc: 'Shampoos and brushes for a shiny coat.' };
      default: return { title: 'Shop for Your Beloved Pets', desc: 'Everything your pet needs in one place.' };
    }
  };

  const heroContent = getHeroContent();

  return (
    <div className="shop-wrapper">
      
      {/*  BANNER */}
      <div className="shop-hero">
        <div className="shop-hero-content">
          <h1>{heroContent.title}</h1>
          <p>{heroContent.desc}</p>
          <button className="btn-hero-shop">Check New Arrivals</button>
        </div>
      </div>

      <div className="container shop-layout">
        
        {/* () */}
        <div className="shop-sidebar">
          <div className="sb-section">
            <h3>Categories</h3>
            <ul className="cat-list">
              <li className={selectedCategory === 'All' ? 'active-cat' : ''} onClick={() => setSelectedCategory('All')}>
                <Box size={16}/>  
              </li>
              <li className={selectedCategory === 'Food' ? 'active-cat' : ''} onClick={() => setSelectedCategory('Food')}>
                <Bone size={16}/> 
              </li>
              <li className={selectedCategory === 'Toys' ? 'active-cat' : ''} onClick={() => setSelectedCategory('Toys')}>
                <Box size={16}/> 
              </li>
              <li className={selectedCategory === 'Accessories' ? 'active-cat' : ''} onClick={() => setSelectedCategory('Accessories')}>
                <ShoppingBag size={16}/> 
              </li>
              <li className={selectedCategory === 'Grooming' ? 'active-cat' : ''} onClick={() => setSelectedCategory('Grooming')}>
                <Scissors size={16}/> 
              </li>
            </ul>
          </div>

          <div className="sb-section">
            <h3>Price Range</h3>
            <input type="range" min="0" max="100" className="price-range"/>
            <div className="price-labels">
              <span>$0</span>
              <span>$100+</span>
            </div>
          </div>
        </div>

       
        <div className="shop-main">
          
          <div className="shop-controls">
            <div className="search-box">
              <Search size={18} color="#888"/>
              <input type="text" placeholder="Search products..." />
            </div>
            <div className="sort-box">
              <span>Sort by:</span>
              <select onChange={(e) => setSortOption(e.target.value)}>
                <option value="newest">Newest</option>
                <option value="price-low">Price: Low to High</option>
                <option value="price-high">Price: High to Low</option>
              </select>
            </div>
          </div>

          <h2 className="section-title-shop">
            {selectedCategory === 'All' ? 'All Products' : selectedCategory} ({productsToShow.length})
          </h2>

       
          <div className="products-grid">
            {productsToShow.map((product) => (
              <div key={product.id} className="prod-card">
                <div className="prod-img-box">
                  <img src={product.img} alt={product.name} />
                </div>
                <div className="prod-info">
                  <span className="prod-cat">{product.category}</span>
                  <h4>{product.name}</h4>
                  <div className="prod-rating">
                    {[...Array(5)].map((_, i) => (
                      <Star key={i} size={12} fill={i < product.rating ? "#f1c40f" : "#eee"} color="none"/>
                    ))}
                  </div>
                  <div className="prod-bottom">
                    <span className="prod-price">${product.price}</span>
                    <button className="btn-add-cart" onClick={() => onAddToCart(product)}>
                      Add to Cart
                    </button>
                  </div>
                </div>
              </div>
            ))}
          </div>

        </div>
      </div>
    </div>
  );
};

export default Shop;